import './Header.css';

function Header() {
    return (
        <header>
            <h1>Archivist</h1>
            <h2>
                A Dungeons & Dragons 5th Edition<br />
                Character Creation and Leveling Companion App
            </h2>
        </header>
    );
}

export default Header;
